import NameCard from './NameCard'
import './style.css'

function App() {
  return (
    <div className="App">
      <div className="container">
      <h1 className="title">시작하기</h1>
      <NameCard/>
      <input className="input" type="text" value="내 이름"></input>
      </div>
    </div>
  );
}

export default App;
